import React from 'react';

const Sidebar: React.FC = () => {
  return (
    <aside style={styles.sidebar}>
      <ul>
        <li>Item 1</li>
        <li>Item 2</li>
        <li>Item 3</li>
        <ol>ddd,ddd</ol>
      </ul>
    </aside>
  );
};

const styles = {
  sidebar: {
    width: '200px',
    background: '#f4f4f4',
    padding: '15px',
    boxSizing: 'border-box' as 'border-box',
    height: '100vh',
  },
};

export default Sidebar;
